import ReactDom from 'react-dom'

function NavBar() {
  return (
    <header>
      <nav>
        <a href='index.html'>Home</a>
        <a href='index.html'>About</a>
        <a href='index.html'>Events</a>
        <a href='index.html'>Next</a>
        <a href='index.html'>Awards</a>
      </nav>
    </header>
  )
}


function MainContent() {
  return (
    <main>
      <section>
        <h1>Welcome to Learn React with Le Roy</h1>
        <p>I am really excited to be teaching you guys React. The course is a really function course and you'll really learn a lot from it.</p>
      </section>
    </main>
  )
}
ReactDom.render(
  <div>
    <NavBar />
    <MainContent />
  </div>
, document.getElementById('root'));
